import React from "react";

const Home = () => {
  // Vous pouvez remplacer ces données factices par les données réelles de votre application
  const cars = [
    { id: 1, name: "Voiture 1", model: "Modèle A" },
    { id: 2, name: "Voiture 2", model: "Modèle B" },
    { id: 3, name: "Voiture 3", model: "Modèle C" },
  ];

  return (
    <div>
      <h1>Bienvenue sur notre service de location de voitures</h1>
      <p>
        Découvrez notre large sélection de voitures et trouvez celle qui
        correspond à vos besoins.
      </p>

      <h2>Voitures Disponibles</h2>
      <ul>
        {cars.map((car) => (
          <li key={car.id}>
            {car.name} - {car.model}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
